import './App.css';

function Alert({ header, body }) {
  return (
    <div className="alert">
      {header && <h5>{header}</h5>}
      {body}
    </div>
  );
}

function App() {
  return (
    <div className="App">
      <div className="setup">
        <p>Alert Setup</p>
        {/* <input type="checkbox"></input> */}
        <div className="setup--header">Header</div>
        <div className="setup--body">Body</div>
      </div>
      <div className="examples">
        <div className="example">
          <p>Current</p>
          <Alert />
        </div>
        <div className="example">
          <p>New</p>
          <Alert />
        </div>
      </div>
    </div>
  );
}

export default App;
